sql_query:
SELECT Employees
FROM company
WHERE CompanyName = 'Contango';

SELECT CompanyName, BusinessStatus
FROM company
WHERE CompanyName = 'Contango';

SELECT CompanyName, TotalRaised, Employees, YearFounded
FROM company
WHERE CompanyName = 'Contango';

SELECT CompanyName, TotalRaised, Employees, YearFounded 
FROM company 
WHERE LOWER(companyAlsoKnownAs) LIKE LOWER('%Contango%');
